def mean_solve(pufdf, pufname, pufsize, min_train_acc):
    m_df = pd.DataFrame(columns=['puf','algo','size','crp','train','test']) # build a dataframe with columns = puf...
    for ialgo in ('ann','lr','svm','fnn','adab'):
        for icrp in pufdf['crp'].unique():
            if icrp < 32767:
                meantrain=pufdf[(pufdf['algo']==ialgo) & (pufdf['crp']==icrp) & (pufdf['train']>=min_train_acc)].loc[:,'train'].mean()
                #meantrain=pufdf[(pufdf['algo']==ialgo) & (pufdf['crp']==icrp)].loc[:,'train'].mean()
                meantest=pufdf[(pufdf['algo']==ialgo) & (pufdf['crp']==icrp)  & (pufdf['train']>=min_train_acc)].loc[:,'test'].mean()
                tempdf=pd.DataFrame({
                    'puf'  :pufname,
                    'algo' :ialgo,
                    'size' :pufsize,
                    'crp'  :icrp,
                    'train':meantrain,
                    'test' :meantest
                },index=[0])
                m_df = pd.concat([m_df, tempdf],ignore_index=True)
    return m_df
